&lt;p&gt;Another progressive film comes to you from the makers of Unleashed, Road to 
  Madness and Daily Dose. This season, Strait Jacket Films brings you Committed, 
  a film containing some of the most underground, up-and-coming riders, as well 
  as some of the best pros out making their mark on the snowboarding world today. 
  Committed will bring you amazing riders attempting the most consequential city 
  and park handrails as well as the best jumps of the season! Committed also features 
  a variety of HUUUUGE backcountry powder kickers and some crazy snowmobiling 
  by your favorite riders. Athletes include: JF Fortin, Jason Murphy, Brandon 
  Bybee, Max Henault, Brett Butcher, Dean Barbier, Mikko Rajakangas, Danny Garrity, 
  Guillaume Brochu, Travis Robison, Simon Chamberlain, Mason Aguirre and Shaun 
  White. Don?t miss it, coming September 1, 2004! FEATURING: JF Fortin Jason Murphy 
  Brandon Bybee Max Henault Brett Butcher Dean Barbier Mikko Rajakangas Danny 
  Garrity Guillaume Brochu Travis Robison Simon Chamberlain Mason Aguirre Shaun 
  White
&lt;/p&gt;
